"Мастер пера" о росте числа инвалидов в мире: 
Сегодня Международный день инвалидов, учреждённый Генассамблеей ООН ещё в 1992 году, когда число людей с инвалидностью в мире перевалило за миллиард. С тех пор минуло более трёх десятков лет, мир не стал благополучнее и бесконфликтнее, чем раньше. Не мудрено, что инвалидов становится больше, а не меньше. По данным ВОЗ, сейчас во всем мире насчитывается уже 1,3 миллиарда инвалидов, хотя ещё в 2021 –ом году удавалось удерживать численность инвалидов на уровне 90-х годов, то есть на отметке около миллиарда человек. Однако за последние годы случилось что-то такое, что привело к росту инвалидов и инвалидности в мире. Очевидно, нынешние двадцатые годы стали для человечества ещё более лихими, чем 90-е. И это ещё один сигнал о том, что мир следует беречь, о близких — заботиться, а с оппонентами если и дискутировать, то по возможности в рамках словесных дуэлей.
